insert  into `emails`(`email_id`,`slug`,`email_subject`,`email_body`) values (1,NULL,'Verify your email address','<p>\r\n	<strong>Hi {firstname},</strong></p>\r\n<p>\r\n	To complete your signup for ELIRA Ticketing, you must click on the link below to verify your email account.</p>\r\n<p>\r\n	{VerificationLink}</p>\r\n<p>\r\n	You can also copy and paste the link in your browser to complete the signup process.</p>\r\n<p>\r\n	You have 24hrs in which to verify your account. If you fail to do so within this timeframe, you will have to re-create your account.</p>\r\n\r\n\r\n<p>\r\n	Thanks,<br />\r\n	The ELIRA Ticketing Team<br />\r\n	www.elira-ticketing.com</p>\r\n\r\n\r\n\r\n\r\n'),(2,NULL,'Welcome to ELIRA Ticketing','<p>\r\n	<strong>Hi {FirstName},</strong></p>\r\n<p>\r\n	Thanks for signing up with MyDealsJa, Jamaica&#39;s premium bargain website!</p>\r\n<p>\r\n	{VerificationLink}</p>\r\n<p>\r\n	To complete the sign-up process please click on the hyperlink listed above.You can also copy and paste the link in your browser.</p>\r\n<p>\r\n	You have 24hrs in which to verify your account. If you fail to do so within this timeframe, you will have to re-create your account.</p>\r\n<p>\r\n	Each day, check your email, Facebook or Twitter feeds for details on deals from some of Jamaica&#39;s finest businesses and brands.</p>\r\n<p>\r\n	With one easy click, purchase your deal. Print your voucher, and take it to the retailer within the specified time frame, and enjoy your deal!</p>\r\n<p>\r\n	We look forward to providing you with more of the best deals in Jamaica.</p>\r\n<p>\r\n	Thank you,</p>\r\n<p>\r\n	The MyDealsJa Team</p>\r\n'),(4,'dispatch_requisition','A new requisition needs to be dispatched','<p>\r\n	<strong>Hi {first_name},</strong></p>\r\n<p>\r\n	A new Requisition was created for {client_name} with Flight No {flight_no}.</p>\r\n\r\n<p>Please log into the SIR Application to dispatch it! </p>\r\n<p>\r\n	Regards,<br />\r\n	SIR</p>\r\n'),(5,'low_stock_level','Low Stock Level','<p>\r\n	<strong>Hi {first_name},</strong></p>\r\n<p>\r\n	{product_name} has reached/gone below its minimum stock level after being used in \r\na requisition.</p>\r\n\r\n<p>\r\n	Regards,<br />\r\n	SIR</p>\r\n'),(6,'approve_po','A new Purchase Order has been created and needs your attention','<p>\r\n	<strong>Hi {first_name},</strong></p>\r\n<p>\r\n	A new Purchase Order has been created and needs your approval.</p>\r\n<<p>\r\n	Regards,<br />\r\n	SIR</p>\r\n');

